import React, {Component} from 'react';
import {Col, Container, Nav, Navbar, Row, Tab} from "react-bootstrap";
import store from "../Store";
import NavBar from "../NavBar";
import TabContent from "../TabContent";

class Diocese extends Component {
    render() {

        let navbar = store.diocese.map(el => <NavBar name={el.name} id={el.id}/>);
        let tabContent = store.diocese.map(el => <TabContent eventKey={el.eventKey}/>);

        return (
            <div>
                <Container>
                    <Navbar collapseOnSelect>
                        <Navbar.Toggle aria-controls='responsive-navbar-nav'/>
                        <Navbar.Collapse id='responsive-navbar-nav'>
                            <Nav>

                                <Nav className='mr-auto'>
                                    <Nav.Link href='/'>Додому</Nav.Link>
                                    <Nav.Link href='/diocese'>Єпархії</Nav.Link>
                                    <Nav.Link href='/region'>Області</Nav.Link>
                                    <Nav.Link href='/observe'>Додати</Nav.Link>
                                    <Nav.Link href='/actual'>Актуальні засідання</Nav.Link>
                                </Nav>

                                {/*<Tab.Container id='left-tabs-example' defaultActiveKey="0">
                                    <Row>
                                        <Col sm={3}>
                                            <div> {navbar}</div>
                                        </Col>
                                        <Col sm={9}>
                                            <div> {tabContent} </div>
                                        </Col>
                                    </Row>
                                </Tab.Container>*/}
                            </Nav>
                        </Navbar.Collapse>
                    </Navbar>
                </Container>
            </div>
        );
    }
}

export default Diocese;
